
window.onload = function () {
  console.log("Map loading with pattern fill using switch logic...");

  const svg = document.querySelector("svg");
  if (!svg) {
    console.error("SVG not found.");
    return;
  }

  const svgNS = "http://www.w3.org/2000/svg";
  const xlinkNS = "http://www.w3.org/1999/xlink";

  const defs = document.createElementNS(svgNS, "defs");

  function createPattern(id, base64, width = 150, height = 150) {
    const pattern = document.createElementNS(svgNS, "pattern");
    pattern.setAttribute("id", id);
    pattern.setAttribute("patternUnits", "userSpaceOnUse");
    pattern.setAttribute("width", width);
    pattern.setAttribute("height", height);

    const image = document.createElementNS(svgNS, "image");
    image.setAttribute("width", width);
    image.setAttribute("height", height);
    image.setAttributeNS(xlinkNS, "href", base64);

    pattern.appendChild(image);
    return pattern;
  }

  defs.appendChild(createPattern("waterPattern", "data:image/jpeg;base64,"));
  defs.appendChild(createPattern("sandPattern", "data:image/jpeg;base64,"));
  defs.appendChild(createPattern("mossPattern", "data:image/jpeg;base64,"));

  svg.insertBefore(defs, svg.firstChild);

  const shapes = Array.from(svg.querySelectorAll("path"));
  shapes.forEach((el) => {
    const label = el.getAttribute("data-label")?.trim() || "";
    const lowerLabel = label.toLowerCase();

    switch (lowerLabel) {
      case "water":
        el.style.fill = "url(#waterPattern)";
        break;
      case "land":
        el.style.fill = "url(#sandPattern)";
        break;
      case "uphill":
        el.style.fill = "url(#mossPattern)";
        break;
      case "docks":
        el.style.fill = "burlywood";
        break;
      case "parking lot":
        el.style.fill = "darkgray";
        break;
      case "fenced yard":
        el.style.fill = "lightgray";
        break;
      case "building":
        el.style.fill = "black";
        break;
      default:
        el.style.fill = "yellow";
        break;
    }
  });

  const zoomScript = document.createElement("script");
  zoomScript.src = "https://cdn.jsdelivr.net/npm/svg-pan-zoom@3.6.1/dist/svg-pan-zoom.min.js";
  zoomScript.onload = () => {
    const panZoom = svgPanZoom(svg, {
      zoomEnabled: true,
      controlIconsEnabled: false,
      fit: true,
      center: true,
      contain: true,
      minZoom: 0.5,
      maxZoom: 20,
      zoomScaleSensitivity: 0.2
    });
    console.log("Pan/Zoom initialized.");
    panZoom.fit();
    panZoom.center();
  };
  document.body.appendChild(zoomScript);

  fetch("https://docs.google.com/spreadsheets/d/1_6MBsTuFBe-dY4y6Yag-4Y7uwhv1CuoXXBMaG-w9axU/export?format=csv")
    .then(response => response.text())
    .then(csv => {
      const rows = csv.split("\n").map(row => row.split(","));
      console.log("CSV Rows:", rows.slice(0, 5));
      rows.forEach((row, i) => {
        const label = row[2]?.trim();
        const status = row[3]?.trim().toLowerCase();
        if (!label) return;

        const shape = shapes.find(el => el.getAttribute("data-label") === label);
        if (
          shape &&
          status === "occupied" &&
          !["water", "land", "uphill"].includes(label.toLowerCase())
        ) {
          shape.style.fill = "lightgreen";
        }
      });
    })
    .catch(err => console.error("Error fetching sheet:", err));
};
